        "message": "Kansas City/independence MO What a great time. While the Truman library was “full” (limited number of folks can enter for the day), we went instead to the Truman House where a bored ranger took us on a tour of the outside and explain all kinds of trivia about the Truman’s. Along with all the great stories of their private lives, he took us out back to the garage to see the last cat that Harry ever owned (complete with a custom license plate commemorating the surrender of Germany). Coupled with a video of their daughter Margaret interviewing them both on an old recording , provided a rare insight to the Truman’s. Really looking forward to coming back. Afterward took a nice walk in a local park and got to play with the Canadian geese.",
