        "created_time": "2021-07-08T13:12:33+0000",
        "type": "photo",
        "message": "Kansas City, MO The journey continues! We left iola, KS (putting another state on our travel map) and drive a couple hours up the road. Now that we don’t have a lot of specific places to be at specific times, we find that we like a 2-3 hour move better than a 12 hour drive day.We ended up at (yet another) elk club in blue springs (about 30 min east of Kansas City) that is gorgeous. We back up to a huge valley and green spaces with 50 amp service , water and sewer for $25 a night - campers trifecta. Below are some pics of our morning view.I’m on a quest to see all the presidential libraries for modern presidents and they are finally starting to reopen. As we drove thru the Midwest, the Truman library is an obvious stop. We rolled into a wonderful elks club for a couple of days. Unfortunately, the library uses timed tickets and they are full up for the next several days. We do have a couple of places we need to be in a bit so we can’t stay long enough to get in so we will have to come back some other day.Teresa found “stuff to do” in the mean time. We went to union station, built in 1914, abandoned and then refurbished to a great attraction. As we drove in yesterday, the rain came down in BUCKETS to the point we almost couldn’t see the road. It cleared up about an hour later. Attached are some photos of the station. It was HUGE. Several small museums inside (the lego and train exhibits were cute) as well as just walking around the massive open structure. Afterwards, we went to the Westin across the street for a glass of ice tea and sat in the atrium. Teresa is pictured here next to a large indoor waterfall.Tomorrow we are off to see more of the city and then leave for Nebraska.",
