        "type": "status",
        "message": "The Jorgensen’s are on the move again!Well, we had a little medical scare that turned out to be nothing but it was disturbing enough that we decided to divert to Dallas to see our doctor in person. After seeing a specialist that gave us the “all clear”, we left Dallas this week to continue our journey north. While we were in Dallas, we connected up with our good friend mark Loovis and had amazing BBQ at the Pecan Lodge (not to be missed). Our standard “goto accommodations” at our elks lodge were full but we found a great alternative at the Arlington elks with 50 amp service (must have in the summer) next to a golf course and under trees to keep us cool. Definitely a place to return!We packed up just before the 4th and stayed at our next “goto place”, and he elks lodge just north of Oklahoma City where were were treated to a great 4th of July cookout and fireworks show. Along the way, met new friends mark and Debra McCoy. We loved our time sharing stories and plans for the road and hope to meet up with them along our travels!Stay tuned for our next episode as we co to us to explore our country!"
